                        "Desc": "<color style='color:#FFD780;'>Обычная атака</color><br>Производит до четырёх последовательных выстрелов из лука.<br><br><color style='color:#FFD780;'>Атака в падении</color><br>Выпускает град стрел, которые при приземлении персонажа наносят урон по площади.<br><br><color style='color:#FFD780;'>Заряженная атака</color><br>Более меткий <color style='color:#FFD780;'>прицельный выстрел</color> с увеличенным уроном.<br>Во время прицеливания на наконечнике стрелы собирается сила пламени. Эффект зависит от длительности заряда стрелы:<br> ·  Уровень заряда 1: выпускает стрелу, наполненную силой Пиро, которая наносит <color style='color:#FF9999;'>Пиро урон</color>.<br> ·  Уровень заряда 2: выпускает стрелу-реквизит, которая наносит <color style='color:#FF9999;'>Пиро урон</color> и при попадании вызывает Хохочущего котошляпа.<br>Если во время выстрела стрелой-реквизитом у Лини более 60% HP, он жертвует частью HP и получает 1 уровень Избыточного реквизита. Эффект может складываться до 5 раз и пропадает через 30 сек. после того, как Лини покидает бой.<br>При использовании этого способа HP Лини не может опуститься ниже 60% от его макс. HP.<br><br><color style='color:#FFD780;'>Хохочущий котошляп</color><br> ·  Дразнит врагов, отвлекая их атаки на себя. Котошляп может дразнить каждого из врагов один раз в 5 сек.<br> ·  Его прочность зависит от макс. HP Лини.<br> ·  Если его уничтожают, либо если его время заканчивается, он выстреливает в 1 противника поблизости <color style='color:#FFD780;'>Пиротехническим снарядом</color>, который наносит <color style='color:#FF9999;'>Пиро урон</color>.<br>Одновременно может существовать только 1 котошляп.<br><br><color style='color:#FFD780;'>Архэ: Пневма</color><br>С некоторым интервалом, на месте попадания стрелы-реквизита нисходит Игла дыхания душ, наносящая <color style='color:#FF9999;'>Пиро урон</color> пневмы.",
